Rozważmy algorytm BFS postaci:

```
/* Vertex.index - indeks wierzchołka
   Vertex.parent - indeks wierzchołka-rodzica W drzewie rozpinającym grafu G */

List BFS(Graph G, Vertex s) {
  // G - graf wejściowy G=(V, E)
  // wierzchołek startowy

  bool Checked[size (G.V)]; // tablica incjalizowana wartościami FALSE
  Queue Q; // kolejka początkowo pusta

  Vertex tmp;
  List L; // lista wierzchołków grafu w kolejności odwiedzania, początkowo pusta

  s.parent:=s; // dla innych wierzchołków początkowo UNDEF
  IN(0, s);
  Checked[s.index]:=TRUE;
  while (EMPTY(Q)=FALSE) do {
    tmp:=FIRST(Q);
    OUT(Q);
    INSERT_END(L, tmp); // odwiedzamy wierzchołek
    for (every neighbour ngh of vertex tmp) do
      if (Checked[ngh.index]=FALSE) then {
        ngh.parent:=tmp.index; // ustalenie wierzchołka-rodzica
        IN (0, ngh);
        Checked[ngh.index]=TRUE;
      }
  }

  return L;
}
```

