Rozważmy algorytm sortowania RadixSort, zaimplementowany przy użyciu struktur pomocniczych kolejek, postaci:

```
// elem liczba możliwych wartości składowych elementu tablicy wejściowej (obiektu)
// elem_value(o, i) wartość i-tej składowej obiektu o

void RadixSort(object E[], int d) {
  // E - tablica obiektow
  // d - liczba pozycji składowych obiektu

  int i, j, k;
  Queue Q[elem]; // tablica kolejek pomocniczych rozmiaru elem

  for (i:=d; i>0; i:=i-1) do {
    for (j:=0; j<size (E); j:=j+1) // wstawianie obiektów do kolejek względem wartości i-tej składowej
      IN(Q[elem value (E[j], i)],E[j]);

    k:=0;
    for (j:=0; j‹elem; j:=j+1) do { // przepisywanie obiektów do tablicy
                                    // z zachowaniem wlaściwego porzadku
      while (EMPTY (Q[j])=FALSE) {
        E[k] : =FIRST (Q[j]);
        OUT(Q[j]);
        k:=k+1;
      }
    }
  }
}
```

